import styled from "styled-components";


const Solove = styled("img")`
  width: 100%;
  height: 100px;
  margin-bottom: 30px;
    border-radius: 10%;
`;

const Container = styled("div")`
  width: 100vw;
  height: 100px;
  background-color: #8a2be2;
  display: flex;

  `
const Title = styled("h1")`
  margin:0
`

const Navbar = () => {
  return(
    <Container>
      <Solove src="/Solove_logo.png" alt=""/>
    </Container>
  )
}

export default Navbar;
